import React from 'react'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
let settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    cssEase: "linear"
}
function Card(props) {
    const getCard = props.card
    return (  
        <div>
            {getCard.map((items)=>
            <div>
                <p>{items.name}</p>
                <img style={{width:"100px",height:"100px"}} src={items.avatar}/>
                <p>{items.gianguoilon}</p>
            </div>
        ) 
        }
        </div>
    )
}

export default Card
